import {
    Link,
} from "react-router-dom";

const Home = () => {
    return (
        <>
            <Container>
                <Row>
                    <Col md={6} style={{ textAlign: 'end' }}>
                        Studi Independen Kampus Merdeka <br />
                        <b>by Ruang Guru</b>
                    </Col>
                    <Col md={6}>
                        <b>Student Portal</b><br />
                        <Link to="/student"><Button variant="dark" data-testid="student-btn">All Student</Button></Link>
                    </Col>
                </Row>
            </Container>
            <style>{`
                body {
                    background-image: url("assets/homepage.jpeg");
                }
            `}</style>
        </>
    )
};

export default Home;
